import React from "react";
import Link from "next/link";

import { Menu } from "antd";

import "antd/dist/antd.css";

const Navigation = () => {
  return (
    <Menu.Item mode="horizontal">
      <Menu.Item>
        <Link href="/">
          <a>HOME</a>
        </Link>
      </Menu.Item>
      <Menu.Item>
        <Link href="/profile">
          <a>HOME</a>
        </Link>
      </Menu.Item>
      <Menu.Item>
        <Link href="/signup">
          <a>HOME</a>
        </Link>
      </Menu.Item>
    </Menu.Item>
  );
};

export default Navigation;
